@-moz-document url-prefix("https://www.google"), url-prefix("https://accounts.google.com")
{
  body, #srp, #tbo, #vasq, #rcnt
  {
    background-image: url(http://orig00.deviantart.net/10a7/f/2013/099/2/3/anime_hd_wallpapers_black_anime_girls_by_ipodpunker-d612tui.jpg);
    background-attachment: fixed;
    background-size: 100% 100%;
  }

  div.ab_tnav_wrp, div.rc, .hdtb_msb, #top_nav, #hdtb
  {
    background-color: rgb(57, 56, 58) !important;
    border-radius: 0%;
  }

  #appbar, #hdtbSum, #hdtb
  {
    background-color: rgb(163, 29, 89) !important;
  }

  #topbar, #extbar, .ab_tnav_wrp, ._ucd:hover, #hdtbSum
  {
    background-color: rgb(163, 29, 89) !important;
  }

  .sbibod, .sfsbc, .gstl_0, .rg_fbl, .rg_fbl:hover, .str.hmov
  {
    border: solid rgb(57, 56, 58) 1px !important;
    background-color: rgb(57, 56, 58) !important;
    box-shadow: none !important;
  }

  ._ucd
  {
    color: black;
    background-color: rgb(163, 29, 89) !important;
    border: none !important;
  }

  ._ucd:hover
  {
    background-color: rgb(142, 139, 145) !important;
  }
}
